def lcp(a, b):
    i=0
    while(i<len(a) and i<len(b) and a[i]==b[i]):
        i+=1
    return i

#texto grande
T = ""

cover = 32
l=[]
for i in range(0, len(T), cover):
    l.append(T[i:i+cover])

#remove repetidos
s = set(l)
l = list(s)

l.sort()
lcp_mean = 0
for i in range(len(l)):
    if(i==0):
        print(l[i], 0, sep="  ")
    else:
        r = lcp(l[i], l[i-1])
        lcp_mean += r
        print(l[i], r, sep="  ")

print("LCP_mean =",lcp_mean/len(l))
print("n. de regras com C = {} igual à {}".format(cover, len(l)))
    
